import React from "react";
import "./directory.style.scss";
import MenuItem from "../menu-item/menu-item.component";

class Directory extends React.Component {
  constructor() {
    super();

    this.state = {
      productSection: [
        {
          id: 1,
          title: "Beauty",
          image: "https://www.planetorganic.com/images/categories/small_AUTO_VeganBeauty.jpg",
        },

        {
          id: 2,
          title: "Health and Fitness",
          image: "https://www.planetorganic.com/images/categories/small_AUTO_VeganHealth.jpg",
        },
        {
          id: 3,
          title: "Groceries",
          image: "https://www.planetorganic.com/images/categories/small_AUTO_VeganGroceries.jpg",
        },
        {
          id: 4,
          title: "Offers and Discounts",
          image:'https://www.planetorganic.com/images/categories/small_VEGAN_OFFERS.jpg',
          size:'large'

        },
        {
          id: 5,
          title: "Clothing",
          image:'https://www.planetorganic.com/images/categories/small_VEGAN_OFFERS.jpg',
          size:'large'
          
        },
      ],
    };
  }

  render() {
    return (
      <div className="directory-menu">
        {this.state.productSection.map(({ title,image,id,size }) => {
          return <MenuItem title={title} image={image} size={size}/>;
        })}
      </div>
    );
  }
}

export default Directory;
